import logo from '../../Images/Logo.png';
import './logo.css';

function Logo  ()  {
  return (
    <div className='logo'>
        <p><strong>B</strong>ooks</p>
      <img src={logo} 
      alt="logo" 
      className='logo-img '/>

    </div>
  );
};

export default Logo;
